/* eslint-disable no-useless-constructor */
import React, { Component} from "react";

const Education = (props) => {

    const { education } = props;

    return(
        <div className="educationDiv">
            {education.map((degree) => {
                return(
                    <div className="degree">
                        <div className="school">
                            <p>{this.props.education.degree.school}</p>
                        </div>
                        <div className="major">
                            <p>{this.props.education.degree.major}</p>
                        </div>
                        <div className="minor">
                            <p>{this.props.education.degree.minor}</p>
                        </div>
                        <div className="degreeStartDate">
                            <p>{this.props.education.degree.degreeStartDate}</p>
                        </div>
                        <div className="degreeEndDate">
                            <p>{this.props.education.degree.degreeEndDate}</p>
                        </div>
                    </div>
                )
            })}
        </div>

    )
}


export default Education;
